-- ClearWay Sample Data (Simplified for bulk import)
-- Purpose: Set up the necessary foreign key references for raw data ingestion.
-- ==============================================

-- Ensure necessary base records exist for Foreign Key references (sessions, raw_measurements)

-- 1. Create a dummy vehicle (required for sessions and width calculation)
-- Note: width 208 centimeters (using value from the original Ford Transit sample)
VALUES ('11111111-1111-1111-1111-111111111111', 'ClearWay Test Vehicle', 208)
ON CONFLICT (id) DO NOTHING;

-- 2. Create a dummy sensor (required for sessions)
VALUES ('22222222-2222-2222-2222-222222222222', 'Test Sensor for Bulk Data', true)
ON CONFLICT (id) DO NOTHING;

-- 3. Create the session (CRITICAL: This ID is referenced by all data in /sql/output.sql)
VALUES ('00000000-0000-0000-0000-000000000000', '22222222-2222-2222-2222-222222222222', '11111111-1111-1111-1111-111111111111')
ON CONFLICT (id) DO NOTHING;

-- ==============================================
-- RAW MEASUREMENTS BULK IMPORT
-- ==============================================

BEGIN;
COMMIT;

-- ==============================================
-- VERIFICATION
-- ==============================================

DO $$
DECLARE
    -- Standard spaces used here to prevent parsing errors
    raw_count INTEGER;
BEGIN
    -- Count the records added by the bulk import
    SELECT COUNT(*) INTO raw_count FROM raw_measurements;
    
    RAISE NOTICE '============================================';
    RAISE NOTICE 'ClearWay Raw Data Load Complete';
    RAISE NOTICE '============================================';
    RAISE NOTICE 'Sessions created: 1';
    RAISE NOTICE 'Total Raw measurements imported: %', raw_count;
    RAISE NOTICE '============================================';
END $$;